INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 1, 10040, "あたしだって\nやるときはやるよ！", 1, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24001, 0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 1, 10040, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24002, 1);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 1, 10040, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24003, 2);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 2, 10040, "やったね！\nこれでようやく\nサボれるよ…", 2, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24004, 3);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 1, 10040, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24005, 4);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 2, 10040, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24006, 5);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 2, 10040, "あたしも意外と\nやるもんでしょ？", 2, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24007, 6);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 4, 10040, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24008, 7);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 4, 10040, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24009, 8);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 4, 10040, "まじめに\nやったんだけどな…\n悔しいな～", 4, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24010, 9);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 4, 10040, "やられた…\nねずみって意外と\nてごわいね", 4, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24011, 10);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 0.0, "リン", 4, 10040, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24012, 11);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (24, "2020/04/30 12:00:00", 1.81, "リン", 4, 10040, "疲れた…\nけど、次こそは\n守り抜くよ…", 1, "2030/12/17 14:59:59", 102601, 0.0, 0.0, 24013, 12);
